import {Typography, Container, ImageListItem} from '@mui/material';
function Home(){
    return (
       <Container>
        <Typography sx={{alignItems: 'center', justifyContent:'center'}}> Topher Emby </Typography>
        <ImageListItem src='https://github.com/Topher2014/TopherEmby/blob/main/TopherEmby.png?raw=true' alt='TopherEmby'></ImageListItem>
       </Container> 
    )
    // client/public/TopherEmby.png
}

export default Home
